import React from 'react';
import Link from 'next/link';
import Router from 'next/router';

const index = () => {
    return (
        <div>
            <h1>Main Page</h1>
            <Link href='/auth'><a>Go to auth page</a></Link>
            <button onClick={() => Router.push('/auth')}>open auth page</button>
        </div>
    )
};

export default index
